import React from 'react';
import './Food.css';
import { useNavigate } from 'react-router-dom'

 function Food() {

  const navigate = useNavigate()
  const back = ()=>{
    navigate('./Home.js')
  }

  return (
    <>

  <div className='container-Food'>
    <div className='Food-Image'>
      <button onClick={back}>Back</button>
    </div>
     </div>

    </>
  )
}
export default Food;
